Description:
Công việc cần làm: Chỉnh sửa web bán hàng có sẵn (viết trên nền Laravel) - Demo tại địa chỉ: https://au.nhomua.com với các yêu cầu sau: 
1. Chuyển đổi url Tiếng Việt có dấu về không dấu (friendly url SEO); 
2. Tạo chức năng bắt giá tự động từ một số website có sẵn; 
3. Tích hợp Giao hàng tiết kiệm (có API & hướng dẫn tích hợp); 
4. Tích hợp SMS (có sẵn API và hướng dẫn tích hợp); 
5. Tích hợp thanh toán Ngân lượng (có sẵn tài khoản, API + hướng dẫn)
